const Vec2& get_random_vec(double x, double y, double seed) {
    uint32_t h = static_cast<uint32_t>(seed + x*328413u + y*191117u);
    return vectors[h % vectors.size()];
}

// dot product of two Vec2 vectors
double dot_product(const Vec2& v, const Vec2& u) {
    return v.x * u.x + v.y * u.y;
}

// cubic interpolation (smooth step)
double cubic_interpolate(double a, double b, double w) {
    return (b - a) * (3.0 - w * 2.0) * w * w + a;
}

// perlin noise function
double perlin(double x, double y, double seed) {

    int32_t x0 = static_cast<int32_t>(std::floor(x));
    int32_t x1 = x0 + 1;
    int32_t y0 = static_cast<int32_t>(std::floor(y));
    int32_t y1 = y0 + 1;

    Vec2 v00 = { x - x0, y - y0 };
    Vec2 v10 = { x - x1, y - y0 };
    Vec2 v01 = { x - x0, y - y1 };
    Vec2 v11 = { x - x1, y - y1 };

    double s = dot_product(v00, get_random_vec(x0, y0, seed));
    double t = dot_product(v10, get_random_vec(x1, y0, seed));
    double u = dot_product(v01, get_random_vec(x0, y1, seed));
    double v = dot_product(v11, get_random_vec(x1, y1, seed));

    double sx = x - x0;
    double sy = y - y0;

    double a = cubic_interpolate(s, t, sx);
    double b = cubic_interpolate(u, v, sx);

    return cubic_interpolate(a, b, sy);
}

void dispatchWorker(int startX, int startY, int width, int height, int layer_count, int grid_size, double seed, uint8_t*& noise) {

    for (int32_t y = 0; y < height; y++) {
        for (int32_t x = startX; x < width; x++) {

            double amp = 1.0;
            double freq = 1.0;
            double val = 0.0;

            for (int32_t i = 0; i < layer_count; i++) {
                val += perlin(x * freq / grid_size, y * freq / grid_size, seed) * amp;
                freq *= 2.0;
                amp /= 2.0;
            }

            val *= 1.2;
            val = std::min(1.0, std::max(-1.0, val));
            int index = y * width + x;
            noise[index] = static_cast<uint8_t>(std::floor((val + 1.0) * 127.5));
        }
    }
}

